import { Route, Routes } from 'react-router-dom';
import Register from './components/Signup';
import LoginForm from './components/loginform';

function App() {
  return (
    <div className="page">
      <Routes>
        <Route path='/' element={<LoginForm />} />
        <Route path='/Signup' element={<Register />} />
      </Routes>
    </div>
  );
}

export default App;
